import React, { useEffect, useState } from 'react';
import aws from 'aws-sdk';
import pyscript from 'pyscript-react';
import { useNavigate } from "react-router-dom";


const ToScript = () => {
    const navigate = useNavigate();
    const [file, setFile] = useState(null);

    useEffect(() => {
        const s3 = new aws.S3({
            accessKeyId: 'AKIAU4PAKJFYHKHYQX6A',
            secretAccessKey: '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',
            region: 'ap-southeast-2'
        });

        const params = {
            Bucket: 'pptforscript',
            Key: 'sample.pptx'
        };

        s3.getObject(params, function(err, data) {
            if (err) {
                console.log('s3 연결 실패');
                console.log(err, err.stack);
            } else {
                console.log('s3 연결 성공');
                setFile(data.Body);
                if(file) {
                    navigate("/ToScriptS", { state: { file: data.Body } });
                }
                else {
                    console.log('file null')
                }
            }
        });
    }, []);

    return(
        <div>
            <p>{file}</p>
        </div>
    )
}

export default ToScript;
